import React from "react";
import { Route, Switch } from "react-router-dom";
import Home from "../components/home/home.user";


const UserRouting = () => {
  return (
    <Switch>
      <Route exact path="/user/home" component={Home}/>
    </Switch>
  );
};

export default UserRouting;
